import "./Total.css";
import { DataGrid } from "@material-ui/data-grid";
import { DataBarang} from "../../dummyData";
import { useState } from "react";

export default function ListBarang() {
  const [data] = useState(DataBarang);


  const columns = [
    { field: "id", headerName: "ID", width: 90 },
    {
      field: "Nama Perangkat",
      headerName: "Nama Perangkat",
      width: 280,
    },
    { field: "Jenis", 
      headerName: "Jenis", 
      width: 280 
    },
    {
      field: "Jumlah",
      headerName: "Jumlah",
      width: 180,
    },
    {
      field: "Keterangan/Lokasi",
      headerName: "Keterangan/Lokasi",
      width: 280,
    },
  ];

  return (
    <div className="ListBarang">
      <DataGrid
        rows={data}
        disableSelectionOnClick
        columns={columns}
        pageSize={8}
      />
    </div>
  );
}
